<div>
    <h4>Cercosporiose</h4>
    <p>
        Ela é uma doença causada pelo fungo Cercospora coffeicola BerK. & Cooke, fungo necrotrófico, que invade as células e as matam, nutrindo-se das mesmas. Essa doença pode atacar desde mudas no viveiro causando intensa desfolha, afetando o crescimento e desenvolvimento das plantas, ou mesmo lavouras adultas, que além da queda de folhas pode proporcionar queda de frutos. Por isso, a falta de um manejo adequado e sob condições favoráveis para o desenvolvimento dessa doença, pode resultar em grandes perdas na produção.
    </p>
    ");
